import React from "react";
import { Link } from "react-dom";
import Styles from "./NavBar.module.scss";

const NavBar = (props) => {

    return (
        <div className={Styles.wrapper}>
            <Link to="/" >Inventory</Link>
        </div>
    );
}

export default NavBar;
